import React, { useState, useEffect } from 'react';
import UserCard from './UserCard';
import { getUsersWithCompatibleAvailability } from './userUtils';

const Sentcontainer = ({ user, lunchtimeAvailability }) => {
  const [compatibleUsers, setCompatibleUsers] = useState([]);

  useEffect(() => {
    const users = getUsersWithCompatibleAvailability(user, lunchtimeAvailability);
    setCompatibleUsers(users);
  }, [user, lunchtimeAvailability]);

  return (
    <div>
      <h1>Search for Lunchtime Companions</h1>
      {compatibleUsers.length > 0 ? (
        compatibleUsers.map((user) => <UserCard key={user.id} user={user} />)
      ) : (
        <p>No compatible users found.</p>
      )}
    </div>
  );
};

export default SearchPage;
